import { useState, useEffect } from 'react';

function SectionCanPersonalDetail() {
  const [personalDetails, setPersonalDetails] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [editDetails, setEditDetails] = useState({
    Dateofbirth: '',
    PermanenetAddress: '',
    Gender: '',
    Pincode: '',
    MartialStatus: '',
    HomeTown: '',
    PassportNumber: '',
    WorkPermit: ''
  });

  // Fetch personal details when the component mounts
  useEffect(() => {
    const fetchPersonalDetails = async () => {
      try {
        const response = await fetch('http://localhost:8080/personal-details', {
          method: 'GET', // Assuming GET for fetching details
          credentials: 'include',
        });

        const data = await response.json();

        if (response.ok) {
          setPersonalDetails(data.data);
          setIsLoading(false);
        } else {
          console.error(data.message);
          setIsLoading(false);
        }
      } catch (error) {
        console.error('Error fetching personal details:', error);
        setIsLoading(false);
      }
    };

    fetchPersonalDetails();
  }, []);

  const handleEditChange = (e) => {
    const { name, value } = e.target;
    setEditDetails({
      ...editDetails,
      [name]: value
    });
  };

  const handleSave = async () => {
    try {
      const response = await fetch('http://localhost:8080/personal-details', {
        method: 'POST', // Assuming POST for saving edited details
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(editDetails),
        credentials: 'include',
      });

      const data = await response.json();
      if (response.ok) {
        setPersonalDetails(data.data); // Update personal details state
        alert('Details updated successfully');
      } else {
        alert(data.message || 'Error saving details');
      }
    } catch (error) {
      console.error('Error saving personal details:', error);
      alert('Error saving details');
    }
  };

  if (isLoading) {
    return <p>Loading personal details...</p>;
  }

  return (
    <>
      <div className="panel-heading wt-panel-heading p-a20 panel-heading-with-btn">
        <h4 className="panel-tittle m-a0">Personal Details</h4>
        <a data-bs-toggle="modal" href="#Personal_Details" role="button" title="Edit" className="site-text-primary">
          <span className="fa fa-edit" />
        </a>
      </div>
      <div className="panel-body wt-panel-body p-a20">
        <div className="twm-panel-inner">
          <div className="row">
            <div className="col-md-6">
              <div className="twm-s-detail-section">
                <div className="twm-title">Date of Birth</div>
                <span className="twm-s-info-discription">{personalDetails.Dateofbirth || 'Not Provided'}</span>
              </div>
            </div>
            <div className="col-md-6">
              <div className="twm-s-detail-section">
                <div className="twm-title">Permanent Address</div>
                <span className="twm-s-info-discription">{personalDetails.PermanenetAddress || 'Not Provided'}</span>
              </div>
            </div>
            {/* Add other fields as needed */}
          </div>
        </div>
      </div>

      {/* Personal Details Modal */}
      <div className="modal fade twm-saved-jobs-view" id="Personal_Details" tabIndex={-1}>
        <div className="modal-dialog modal-dialog-centered">
          <div className="modal-content">
            <form>
              <div className="modal-header">
                <h2 className="modal-title">Personal Detail</h2>
                <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close" />
              </div>
              <div className="modal-body">
                <div className="row">
                  {/* Date of Birth */}
                  <div className="col-xl-12 col-lg-12">
                    <div className="form-group">
                      <label>Date of Birth</label>
                      <input
                        className="form-control"
                        type="text"
                        name="Dateofbirth"
                        value={editDetails.Dateofbirth}
                        onChange={handleEditChange}
                        placeholder="mm/dd/yyyy"
                      />
                    </div>
                  </div>
                  {/* Gender */}
                  <div className="col-xl-12 col-lg-12">
                    <div className="form-group">
                      <label>Gender</label>
                      <div className="row twm-form-radio-inline">
                        <div className="col-md-6">
                          <input
                            className="form-check-input"
                            type="radio"
                            name="Gender"
                            id="male"
                            value="Male"
                            checked={editDetails.Gender === 'Male'}
                            onChange={handleEditChange}
                          />
                          <label className="form-check-label" htmlFor="male">
                            Male
                          </label>
                        </div>
                        <div className="col-md-6">
                          <input
                            className="form-check-input"
                            type="radio"
                            name="Gender"
                            id="female"
                            value="Female"
                            checked={editDetails.Gender === 'Female'}
                            onChange={handleEditChange}
                          />
                          <label className="form-check-label" htmlFor="female">
                            Female
                          </label>
                        </div>
                      </div>
                    </div>
                  </div>
                  {/* Permanent Address */}
                  <div className="col-xl-12 col-lg-12">
                    <div className="form-group">
                      <label>Permanent Address</label>
                      <input
                        className="form-control"
                        type="text"
                        name="PermanenetAddress"
                        value={editDetails.PermanenetAddress}
                        onChange={handleEditChange}
                        placeholder="Enter Permanent Address"
                      />
                    </div>
                  </div>
                  {/* Hometown */}
                  <div className="col-xl-12 col-lg-12">
                    <div className="form-group">
                      <label>Hometown</label>
                      <input
                        className="form-control"
                        type="text"
                        name="HomeTown"
                        value={editDetails.HomeTown}
                        onChange={handleEditChange}
                        placeholder="Enter Hometown"
                      />
                    </div>
                  </div>
                  {/* Pincode */}
                  <div className="col-xl-12 col-lg-12">
                    <div className="form-group">
                      <label>Pincode</label>
                      <input
                        className="form-control"
                        type="text"
                        name="Pincode"
                        value={editDetails.Pincode}
                        onChange={handleEditChange}
                        placeholder="Enter Pincode"
                      />
                    </div>
                  </div>
                  {/* Marital Status */}
                  <div className="col-xl-12 col-lg-12">
                    <div className="form-group">
                      <label>Marital Status</label>
                      <select
                        className="form-control"
                        name="MartialStatus"
                        value={editDetails.MartialStatus}
                        onChange={handleEditChange}
                      >
                        <option value="Married">Married</option>
                        <option value="Single">Single</option>
                      </select>
                    </div>
                  </div>
                  {/* Passport Number */}
                  <div className="col-xl-12 col-lg-12">
                    <div className="form-group">
                      <label>Passport Number</label>
                      <input
                        className="form-control"
                        type="text"
                        name="PassportNumber"
                        value={editDetails.PassportNumber}
                        onChange={handleEditChange}
                        placeholder="Enter Passport Number"
                      />
                    </div>
                  </div>
                </div>
              </div>
              <div className="modal-footer">
                <button type="button" className="site-button" data-bs-dismiss="modal">Close</button>
                <button type="button" className="site-button" onClick={handleSave}>Save</button>
              </div>
            </form>
          </div>
        </div>
      </div>
    </>
  );
}

